import "./Expenses.css";
import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
  const titlez = props;
  console.log(titlez);
  return (
    <ExpenseItem
      title={titlez}
      amount={props[0]}
      date={props[0].date}
    ></ExpenseItem>
  );
}

export default Expenses;
